import React from "react";
const [data, setData] = useState("");
useEffect(() => {
  axios
    .get("api/hello")
    .then((response) => {
      console.log(response);
      setData(response.data);
    })
    .catch((err) => {
      console.log(err);
    });
}, []);
const Test = () => {
  return <div>Test</div>;
};

export default Test;
